ChamCalibrateXY::ChamCalibrateXY(int img_width, int img_height)
    : center_x(img_width / 2.0), center_y(img_height / 2.0), dm(0.002), fm(1420.0)
{
    initializeTables();
}

float ChamCalibrateXY::radians(float angle_deg)
{
    float angle_rad = angle_deg * M_PI / 180.0;
    return angle_rad;
}

YOLODetectionResult ChamCalibrateXY::real2virXY(const YOLODetectionResult& detection, float angle_yaw, float angle_pitch)
{
    //angle_yaw = -angle_yaw;
    //angle_pitch = -angle_pitch;

    float delta_x = detection.x - center_x;
    float delta_y = detection.y - center_y;

    auto H_xy = lookupDeltaXY(delta_x, delta_y);

    float curr_yaw = std::atan(H_xy[0] / fm);
    // float curr_pitch = std::atan(H_xy[1] / fm);
    float R = std::sqrt(H_xy[0] * H_xy[0] + H_xy[1] * H_xy[1] + fm * fm);
    float curr_pitch = std::asin(H_xy[1] / R);

    float total_yaw = radians(angle_yaw) + curr_yaw;
    float total_pitch = radians(angle_pitch) + curr_pitch;

    float virtual_x = total_yaw * fm;
    float virtual_y = total_pitch * fm;

    YOLODetectionResult virtualDetectionResult = {detection.lable, detection.prob, virtual_x, virtual_y, detection.width, detection.height};
    return virtualDetectionResult;
}

TrackPoint ChamCalibrateXY::real2virXY(float real_x, float real_y, float angle_yaw, float angle_pitch)
{
    //angle_yaw = -angle_yaw;
    //angle_pitch = -angle_pitch;

    float delta_x = real_x - center_x;
    float delta_y = real_y - center_y;

    auto H_xy = lookupDeltaXY(delta_x, delta_y);

    float curr_yaw = std::atan(H_xy[0] / fm);
    // float curr_pitch = std::atan(H_xy[1] / fm);
    float R = std::sqrt(H_xy[0] * H_xy[0] + H_xy[1] * H_xy[1] + fm * fm);
    float curr_pitch = std::asin(H_xy[1] / R);

    float total_yaw = radians(angle_yaw) + curr_yaw;
    float total_pitch = radians(angle_pitch) + curr_pitch;

    float virtual_x = total_yaw * fm;
    float virtual_y = total_pitch * fm;

    TrackPoint point = {virtual_x, virtual_y};
    return point;
}

TrackPoint ChamCalibrateXY::vir2realXY(float vir_x, float vir_y, float angle_yaw, float angle_pitch)
{
    //angle_yaw = -angle_yaw;
    //angle_pitch = -angle_pitch;

    float f_px = fm;

    float curr_yaw_rad = vir_x / f_px - radians(angle_yaw);
    float curr_pitch_rad = vir_y / f_px - radians(angle_pitch);

    float Hx = std::tan(curr_yaw_rad) * f_px;
    // float Hy = std::tan(curr_pitch_rad) * f_px;
    float Hy = std::sqrt(Hx * Hx + f_px * f_px) * std::tan(curr_pitch_rad);

    float Hr = std::sqrt(Hx * Hx + Hy * Hy) * dm;

    float res = 0;
    for (size_t k = 0; k < Z_ref.size(); ++k) {
        if (Z_ref[k] >= Hr) {
            res = Y_real[k];
            break;
        }
    }
    float Real_px = res / dm;

    float phi_xy;
    if (Hy == 0 && Hx == 0) {
        phi_xy = 0;
    } else if (Hy == 0 && Hx != 0) {
        phi_xy = std::abs(M_PI / 2.0);
    } else {
        phi_xy = std::atan(std::abs(Hx / Hy));
    }

    float real_delta_x = Real_px * std::sin(phi_xy) * (Hx < 0 ? -1 : 1);
    float real_delta_y = Real_px * std::cos(phi_xy) * (Hy < 0 ? -1 : 1);

    float real_x = real_delta_x + center_x;
    float real_y = real_delta_y + center_y;

    if (real_x <= 0) {
        real_x = 0;
    }
    if (real_y <= 0) {
        real_y = 0;
    }
    if (real_x >= center_x * 2) {
        real_x = center_x * 2 - 1;
    }
    if (real_y >= center_y * 2) {
        real_y = center_y * 2 - 1;
    }

    TrackPoint point = {real_x, real_y};
    return point;
}

YOLODetectionResult ChamCalibrateXY::vir2realXY(const YOLODetectionResult& detection, float angle_yaw, float angle_pitch)
{
    //angle_yaw = -angle_yaw;
    //angle_pitch = -angle_pitch;

    float f_px = fm;

    float curr_yaw_rad = detection.x / f_px - radians(angle_yaw);
    float curr_pitch_rad = detection.y / f_px - radians(angle_pitch);

    float Hx = std::tan(curr_yaw_rad) * f_px;
    // float Hy = std::tan(curr_pitch_rad) * f_px;
    float Hy = std::sqrt(Hx * Hx + f_px * f_px) * std::tan(curr_pitch_rad);

    float Hr = std::sqrt(Hx * Hx + Hy * Hy) * dm;

    float res = 0;
    for (size_t k = 0; k < Z_ref.size(); ++k) {
        if (Z_ref[k] >= Hr) {
            res = Y_real[k];
            break;
        }
    }
    float Real_px = res / dm;

    float phi_xy;
    if (Hy == 0 && Hx == 0) {
        phi_xy = 0;
    } else if (Hy == 0 && Hx != 0) {
        phi_xy = std::abs(M_PI / 2.0);
    } else {
        phi_xy = std::atan(std::abs(Hx / Hy));
    }

    float real_delta_x = Real_px * std::sin(phi_xy) * (Hx < 0 ? -1 : 1);
    float real_delta_y = Real_px * std::cos(phi_xy) * (Hy < 0 ? -1 : 1);

    float real_x = real_delta_x + center_x;
    float real_y = real_delta_y + center_y;

    if (real_x <= 0) {
        real_x = 0;
    }
    if (real_y <= 0) {
        real_y = 0;
    }
    if (real_x >= center_x * 2) {
        real_x = center_x * 2 - 1;
    }
    if (real_y >= center_y * 2) {
        real_y = center_y * 2 - 1;
    }

    YOLODetectionResult realDetectionResult = {detection.lable, detection.prob, real_x, real_y, detection.width, detection.height};
    return realDetectionResult;
}

std::vector<float> ChamCalibrateXY::calibrateXY(float real_x, float real_y)
{
    float delta_x = real_x - center_x;
    float delta_y = real_y - center_y;

    auto new_delta_xy = lookupDeltaXY(delta_x, delta_y);

    float new_x = center_x + new_delta_xy[0];
    float new_y = center_y + new_delta_xy[1];

    return {new_x, new_y};
}

std::vector<float> ChamCalibrateXY::lookupDeltaXY(float delta_x, float delta_y)
{
    float Real_px = std::sqrt(delta_x * delta_x + delta_y * delta_y);
    float Real_mm = Real_px * dm;

    float res = 0;
    for (size_t k = 0; k < Y_real.size(); ++k) {
        if (Y_real[k] >= Real_mm) {
            res = Z_ref[k];
            break;
        }
    }

    float phi_xy;
    if (delta_y == 0 && delta_x == 0) {
        phi_xy = 0;
    } else if (delta_y == 0 && delta_x != 0) {
        phi_xy = std::abs(M_PI / 2.0);
    } else {
        phi_xy = std::atan(std::abs(delta_x / delta_y));
    }

    float new_H_px = res / dm;
    float new_delta_x = new_H_px * std::sin(phi_xy) * (delta_x < 0 ? -1 : 1);
    float new_delta_y = new_H_px * std::cos(phi_xy) * (delta_y < 0 ? -1 : 1);

    return {new_delta_x, new_delta_y};
}

